const NavBar = () => {

    const [isOpen, setIsOpen] = useState(false);

    const toggleDropdown = () => {
        setIsOpen(!isOpen);
    };

    return (
        <div className='navBar'>
            <div className='dropdown'>
                <button onClick={toggleDropdown} className='dropdown-toggle'>
                    btn
                </button>

            </div>
        </div>
    )
};

export default NavBar;
